import React from 'react';
import ReactDOM from 'react-dom';
import './assets/style/index.css';
import './assets/style/App.css';
import * as serviceWorker from './serviceWorker';
import { Provider } from 'react-redux';
import { createStore, applyMiddleware } from 'redux';
import { rootReducer } from './store/reducers/rootReducder.js';
import { itineraryReducer } from './store/reducers/itineraryReducer.js';
import { Route, BrowserRouter as Router } from 'react-router-dom';
import thunk from 'redux-thunk';
import SecondLandingPage from './containers/SecondLandingPage.js';
import CitiesPage from './containers/CitiesPage.js';
import CityPage from './containers/CityPage.js';

const storeRoot = createStore(rootReducer,  applyMiddleware(thunk));
const itineryStore = createStore(itineraryReducer, applyMiddleware(thunk));

const routing = (
  <Router>
    <div>
      <Route exact path="/" component={SecondLandingPage} />
      <Route path="/cities" component={CitiesPage} />
      <Route path="/itineraries/city/:name" component={CityPage} />
    </div>
  </Router>
);

ReactDOM.render(<Provider store={storeRoot}>{routing}</Provider>, document.getElementById('root'));
ReactDOM.render(<Provider store={itineryStore}>{routing}</Provider>, document.getElementById('root'));
serviceWorker.unregister();
